local renderDistance = 700
Citizen.CreateThread(function()
	--if true then return end
	--ShutdownLoadingScreenNui()

	while true do
		Citizen.Wait(3000)
		local ped = PlayerPedId()
		local plyPos = GetEntityCoords(ped)

		for k,v in pairs(eastYmap) do
			local min, max = v.extends[1], v.extends[2]
			local dist1, dist2 = GetDistanceBetweenCoords(plyPos, min), GetDistanceBetweenCoords(plyPos, max)
			local shouldDraw, IPLActive = plyPos.z > 150 or dist1 < renderDistance or dist2 < renderDistance or (plyPos.x > min.x and plyPos.x < max.x and plyPos.y > min.y and plyPos.y < max.y), IsIplActive(v.name)
			--shouldDraw = true
			if shouldDraw and not IPLActive then
				--Citizen.Trace("Added: " .. v.name .. "\n")
				RequestIpl(v.name)
				--Wait(100)
			elseif not shouldDraw and IPLActive then
				--Citizen.Trace("Removed: " .. v.name .. "\n")
				RemoveIpl(v.name)
			end
		end
	end
end)

RegisterCommand("dist", function(src, args)
	local distance = tonumber(args[1])
	if not distance then return end

	renderDistance = distance <= 0 and 99999 or distance
	TriggerEvent("chatMessage", b or "LibertyCityM", c or {18, 197, 101}, "Distancia de renderizado ajustada a = " .. renderDistance)
	TriggerEvent("chatMessage", b or "LibertyCityM", c or {18, 197, 101}, "El valor por defecto es 700, valores ms altos consumen ms memoria RAM y CPU")
end)

RegisterCommand("dist2", function(src, args)
	local distance = tonumber(args[1])
	if not distance then return end

	renderDistance = distance <= 0 and 99999 or distance
end)

TriggerEvent('chat:addSuggestion', '/dist', 'Modifica la distancia de renderizado del mapa, puede mejorar o disminuir el rendimiento.', {
    { name="700", help="Valores superiores a 700 pueden disminuir el rendimiento" }
})

